import React, {Component} from "react";

import './item-add-form.css'





 export default class ItemAddForm extends Component{
    render(){
        const{addNewItem} = this.props;
        return( 
        <div className="item-add-form">
            <button            type="button" 
            className="btn btn-info  item-add-form"
            onClick={addNewItem}    >
                Add
            </button>
        </div>


        )
    }
}
